window.onload = function() {
    for (var i = 0; i < builtinStates.length; i++) {
        var state = builtinStates[i].state.state;
        var params = builtinStates[i].state.params;
        params.fAppearance = params.fCamera = params.fLighting = true;
        params.sDenoise = "null";
        // params.sDenoise = "runet2gan";
        params.sSpp = state.sSpp = 256;
        state.defaultScreenCenter = true;
    }

    let container = document.getElementById("demos");
    let root = "http://localhost:8000/implicit3-rt";
    // let root = "https://harry7557558.github.io/spirulae/implicit3-rt";
    for (var i = 0; i < builtinStates.length; i++) {
        let obj = builtinStates[i];
        let div = document.createElement("div");
        div.classList = ['demo'];
        let a = document.createElement("a");
        a.href = root + '#' + obj.id;
        let img = document.createElement("img");
        img.src = 'img/' + obj.id + '.jpg';
        a.appendChild(img);
        div.appendChild(a);
        container.appendChild(div);
    }
};

